import React from 'react';
import { Paper, Typography, List, ListItem, ListItemText, ListItemAvatar, Avatar } from '@mui/material';

const clubLogos = {
  "Real Madrid": "https://upload.wikimedia.org/wikipedia/en/5/56/Real_Madrid_CF.svg",
  "Juventus FC": "https://upload.wikimedia.org/wikipedia/commons/1/15/Juventus_FC_2017_logo.svg",
  "Al-Nassr FC": "https://upload.wikimedia.org/wikipedia/en/a/a0/Al_Nassr_FC.svg",
  "Sporting CP": "https://upload.wikimedia.org/wikipedia/en/2/2d/Sporting_CP.svg",
  "Manchester United": "https://upload.wikimedia.org/wikipedia/en/7/7a/Manchester_United_FC_crest.svg"
};

const ClubGoals = ({ data }) => {
  return (
    <Paper style={{ padding: '20px', backgroundColor: 'rgba(0, 0, 0, 0.7)' }}>
      <Typography variant="h5" gutterBottom style={{ color: '#00FF7F' }}>
        Goles por Club
      </Typography>
      <List>
        {Object.entries(data).map(([club, goals]) => (
          <ListItem key={club}>
            <ListItemAvatar>
              <Avatar src={clubLogos[club]} alt={club} />
            </ListItemAvatar>
            <ListItemText 
              primary={club} 
              secondary={`${goals} goles`}
              primaryTypographyProps={{ style: { color: '#FFFFFF' } }}
              secondaryTypographyProps={{ style: { color: '#FFD700' } }}
            />
          </ListItem>
        ))}
      </List>
    </Paper>
  );
};

export default ClubGoals;
